import React,{useEffect,useState} from 'react';
import axios from 'axios';

const Home = (state) => {
    const [data, setData] = useState([]);
  const getData = async () => {
    const { data } = await axios.get(`http://localhost:9000/create-data`);
    setData(data);
  };
  useEffect(() => {
    getData();
  }, []);
  return (<div>{state.name}</div>
    );

}

export default Home;
